export enum Major {
  SI = 'SI',
  GE = 'GE',
  GB = 'GB',
  AI = 'AI',
  CI = 'CI',
  PO = 'PO'
}
export interface Ticket {
  title?: string;
  description?: string;
  date?: Date;
  student?: string;
  major?: Major;
}
